Features:
- Tried and tested software base developed with user feedback over the last 14 years.

Maps:
- Use online maps from OpenStreetMap, OpenCycleMap, USGS Topos; 
- Maps are downloaded on-the-fly as you travel;
- Maps can be cached for off-line use when connectivity is not available;

Tracking (Breadcrumb): 
- Log your travels for later analysis, or use as a route to follow next time out.  
- Pause and continue track timer for precision timing;
- One-touch "BackTrack" feature to find your way home after recording your way out;
- Manage and Edit Track logs and track points;
- Store as many Track logs as you like for use later. 
- Share your location with others and monitor each other in the app.

Points:
 - Capture points, describe by name, icon, description, photo;
- Over 100 icons to choose from;
- Manage and Edit Points;
- Organize your points by creating multiple Points Databases;

Navigation:
- Navigate directly to a single point or follow multi-point routes; 
- Create navigational routes simply by marking the route on the map; 
- Alarms to notify you when you've strayed off your route, or nearing a marked point; 
- Uses built-in magnetic compass for slow speed directional location. Great for Geocaching when you’re trying to pin-point a cache.
- View navigational information on a customizable dashboard;
- Map View or Compass and Info Views;
- Multiple coordinate grid and datum display including lat/long, UTM, OSGB, MGRS, MGA, GGRS87, Warschauer, Localized Grids for Austria, Germany, Quebec, Sweden, Switzerland, Israel.
- Import/Export GPX, KML, KMZ, and PathAway delimited files.

NOTES:
- External GPS (like Bluetooth GPS) is required to obtain location for iPad Wifi.

- For advanced features and support for custom maps (.PRC, BSB/KAP), upgrade to PathAway PRO via in-app upgrade.

SkyLogger is a program for obtaining and storing flight data. The program is especially adapted for the usage by glider, hangglider and paraglider pilots.  SkyLogger obtains the geodetic positions of the pilot during the flight and stores the data. Furthermore, the pilot is able to see during the flight the elapsed time, the distance to the take-off as well as the current ground speed and climb rate. A compass rose is indicating the current flight direction. 
For competitions the pilot's and the aircraft's name, the aircraft's ID and the to be flown route can be entered.  During the flight the direction and distance to the next waypoint are shown on the display.

After finishing the flight the stored geodetic data together with the data for the competition can be converted into the common IGC file format. Additionally, also other popular formats like GPX and KML are supported. The created files are stored on the iPhone or can be sent to servers or other computers.

SkyLogger supports besides others the following features:

 - control by Apple Watch;
 - main data visualization on Apple Watch;
 - cockpit / instrument view;
 - 2D & 3D flight data visualization;
 - downloadable map data;
 - large and individually adaptable instruments on a moving map allow best viewing comfort;
 - north or in flight direction orientation of moving map;
 - live tracking support for Leonardo or Vgps servers
 - visualization of previously flown flights as track traces on moving map;
 - visualization of airspaces with user defined colors;
 - instrument showing the distance and direction to the closest airspace;
 - 3 axis acceleration measurements;
 - tracked flights are stored in highly efficient internal database;
 - default flight parameters can be stored and retrieved to make flight information entering for competitions easier;
 - SkyLoggerXXL supports common file formats like IGC, CSV, GPX and KML;
 - IGC files created by SkyLoggerXXL are OLC conform and can directly be sent to Leonardo, XCCup, XContest and XC globe based OLC servers;
 - calculation of XC points for FAI triangle, triangle and free distance over 5 points;
 - XC analysis (determination of FAI triangle areas);
 - printing of flightbooks, flight information and statistics
 - all diagrams, maps or charts can either be e-mailed or copied for incorporation into other apps;
 - integration of SkyView database for exchanging waypoints;
 - support of FlyNet accessories;
 - support of SensBox;
 - weather data history of selected weather stations for the last 48 hours;
 - online wind speed and direction visualization on maps for selected weather stations;
 - visualization of hotspots;
 - visualization of regions with thermals;
 - visualization of climb rate traces;
 - and much much more!

Warning: Continued use of GPS running in the background can dramatically decrease battery life.
